import React from "react";
import "../css/sidebar.scss";

class Sidebar extends React.Component {
    render() {
        return (
            <nav id='left-sidebar'>
                <div className='left-sidebar__functions'></div>
                <div className='left-sidebar__menu'></div>
            </nav>
        );
    }
}

export default Sidebar;
